import styled from "styled-components"

export const Title = styled.h1`
    position: relative;
    font-family: 'Poppins';
    font-style: normal;
    font-size: 16px;
    color: #1D1617;
    text-align: center;
    top: 16px;
`;

export const Header = styled.div`
    background: #FFFFFF;
    height: 64px;
`;

export const Text1 = styled.text`
    position: absolute;
    width: 123px;
    height: 24px;
    left: 30px;
    top: 105px;
    font-family: 'Poppins';
    font-style: normal;
    font-weight: 600;
    font-size: 16px;
    line-height: 24px;
    color: #1D1617;
`;

export const HeaderButtonLeft = styled.button`
    top: 18px;
    margin-left: 10px;
    left: 10px;
    position: absolute;
    border-radius: 10px;
    border: none;
`;
export const HeaderButtonRight = styled.button`
    margin-right: 10px;
    right: 10px;
    position: absolute;
    border-radius: 10px;
    top: 18px;
    border: none;
`;

export const Container2 = styled.div`
    position: absolute;
    height: 30px;
    width: 76px;
    left: 269px;
    bottom: 833px;
    top: 102px;
    border-radius: 50px;
    background: linear-gradient(274.42deg, #92A3FD 0%, #9DCEFF 124.45%);
`;

export const Text2 = styled.text`
    position: absolute;
    left: 13.16%;
    right: 39.47%;
    top: 26.67%;
    bottom: 23.33%;
    font-family: 'Poppins';
    font-style: normal;
    font-weight: 400;
    font-size: 10px;
    line-height: 15px;
    text-align: right;
    color: #FFFFFF;
`;

export const Container3 = styled.div`
    height: 57px;
    width: 315px;
    left: 30px;
    top: 349px;
    border-radius: 16px;
    position: absolute;
    right: 30px;
    bottom: 559px;
    background: linear-gradient(274.42deg, #92A3FD 0%, #9DCEFF 124.45%);
    opacity: 0.2;
`;

export const Text3 = styled.text`
    position: absolute;
    left: 6.35%;
    right: 48.57%;
    top: 31.58%;
    bottom: 31.58%;
    font-family: 'Poppins';
    font-style: normal;
    font-weight: 500;
    font-size: 14px;
    line-height: 21px;
    color: #1D1617;
`;
export const Container4 = styled.div`
    position: absolute;
    width: 68px;
    height: 28px;
    left: 257px;
    right: 50px;
    top: 364px;
    bottom: 573px;
    background: linear-gradient(274.42deg, #92A3FD 0%, #9DCEFF 124.45%);
    border-radius: 50px; 
`;
export const Text4 = styled.text`
    position: absolute;
    left: 26%;
    right: 65px;
    top: 15%;
    font-family: 'Poppins';
    font-style: normal;
    font-weight: 400;
    font-size: 12px;
    line-height: 18px;
    color: #FFFFFF;
`;
export const Text5 = styled.text`
    position: absolute;
    width: 123px;
    height: 24px;
    left: 30px;
    top: 105px;
    font-family: 'Poppins';
    font-style: normal;
    font-weight: 600;
    font-size: 16px;
    line-height: 24px;
    color: #1D1617;
`; 
export const Container5 = styled.div`
    height: 30px;
    width: 87px;
    left: 0px;
    top: 0px;
    border-radius: 50px;
    background: linear-gradient(274.42deg, #92A3FD 0%, #9DCEFF 124.45%);
`;
